import React from 'react'
import './team.css'
import TeamVideoComponent from './components/TeamVideoComponent'

function TeamComponent(props) {
    return (
        <div ref={props.TeamRef} className='team-component page'>
            <TeamVideoComponent/>
            <div></div>
        </div>
    )
}

export default TeamComponent
